SQLResult.FlowData = '<div id="xut-stream-flow" style="display:none;z-index:-1">   <div id="season-flow-1">   <div id="chapter-flow-1" data-margin="23.5,8.17,5.3,8.17">       <div class="WordSection1">  <p class="a st_13460515cc6897d4" ><span class="st_ad8b6a89ba46a7d4">李子勋</span><span  class="st_57d574c643950445">&#160; </span><span class="st_12a2efca938b9545">中国心理卫生学会咨询与治疗专业委员会成员（心理执业资格），中德心理培训首届学员、</span><span  class="st_bf624072cd744445">CCTV </span><span class="st_12a2efca938b9545">《心理访谈》专家，著有《根源舞》《陪孩子长大》等</span></p>  <p class="xxt1 st_60e699b0f5c18445"  ><span class="st_d2f6b905e3b89c45">全职太太，美好生活的成本有多大？</span></p>  <p class="a st_220834aaa02770ba" ><span class="st_181f65104b7670ba">全职太太是一个看起来很美的职业：没有朝九晚五上班族的竞争压力，只需要轻松地搞定三餐，心情好时还能做个浪漫的烘焙。有了孩子也许会累一些，但是孩子午休时，你可以躺在沙发的阳光里打个盹或者看一本好书。等孩子到了入学年龄，作为妈妈你就可以获得大解放，有时间做美容，种花草，或者是参加一个心灵沙龙，让自己的人生更充实……然而，就目前中国的状况看，全职太太仍不算是一份性价比很高的职业，原因是想要从这份职业中收获幸福，还需要天时地利与人和，即社会、男人及女人自我三方面条件的配合。</span></p>  <p class="xxt2 st_8de914eebc8beeba" ><span class="st_12a2efca938b9545">好心态是幸福的前提</span></p>  <p class="a st_220834aaa02770ba" ><span class="st_c04e05dcac9ece7a">要做幸福的全职太太，就需要想明白一些问题。首先家是自己的家，孩子是自己的孩子，生活也是自己的生活。男人只是来帮忙的——帮你实现理想生活，帮你养育孩子，帮你积攒家私。</span></p>  <p class="a st_220834aaa02770ba" ><span class="st_c04e05dcac9ece7a">人们常说，智慧是女人幸福的前提。而这种看问题的视角，正是有智慧的女人所特有的。愚蠢的女人总是把自己放在从属的位置上——我是那个男人的女人，我在为他养孩子、看房子，如果哪一天男人被抢走了，我的生活就坍塌。</span></p>  <p class="a st_220834aaa02770ba" ><span class="st_c04e05dcac9ece7a">事实上，全职太太的幸福不仅包括上面提到的美容、烘焙、沙龙……这些只是生活的形式，更重要的是心灵的自由与满足——当男人很爱自己的时候，多体验一些情爱的温柔；有心情的时候，也关怀温暖一下那个男人，让他为自己的生活、家和孩子自觉自愿地鞠躬尽瘁。而当男人心猿意马或者身在曹营心在汉的时候，你也能想到自己的生活还在，家与孩子都不会真正地离开你。如果那个男人想离开，你心里充满的不是愤恨，反而有感恩，感激他曾经对自己、自己的家、自己的孩子做出的贡献。</span></p>  <p class="xxt2 st_8de914eebc8beeba" ><span class="st_12a2efca938b9545">成熟自信的男人才能给你“全职幸福”</span></p>  <p class="a st_220834aaa02770ba" ><span class="st_c04e05dcac9ece7a">如果你有了这种豁达平和的心态，那么还要明白一点——全职太太的确是一个高风险的职业，女人的幸福仍有一大部分掌握在男人手里：第一，那个男人是忠贞不渝的，哪怕你人老珠黄，他也能看到你灵魂的魅力，对你情有独钟。第二，家庭经济大权掌握在女人的手里，男人的一切收入（包括房产、公司股份或其他不动产）都有太太一半的份额。</span></p>  <p class="a st_220834aaa02770ba" ><span class="st_c04e05dcac9ece7a">国外的男性比较喜欢成熟的女人，认为</span><span class="st_af6b9b809f7b5d31">35</span><span class="st_c04e05dcac9ece7a">～</span><span class="st_af6b9b809f7b5d31">45</span><span class="st_c04e05dcac9ece7a">岁的女人更懂得爱与体贴，加之懂事的孩子相伴，那时的家是男人的天堂。而中国男人大多内心脆弱，在年轻懵懂的女人面前比较能找到自信，而干练成熟的女性容易激发男人的精神阳痿。所以，我们能看到中国男人普遍喜欢年轻的女人，再加上大男子主义与三妻四妾等残存意识的影响，想让一个男人一辈子不对别的女人动情仿佛是赶牛上树，极不现实。这也是中国的中年女性基本都要为婚姻延续而战的原因之一。</span></p>  <p class="a st_220834aaa02770ba" ><span class="st_c04e05dcac9ece7a">另外，中国的法律对女性权益也没有切实的保障。婚姻法的修改将婚前财产规定为不能变动，而法律对男性财产的监管又不作为，全职太太需要全面介入男人的社会活动才可能真正做到财产知情。这些都决定了，女性必须想办法得到这些保障，以确保“家是自己的家”不只是一种美丽的幻觉。</span></p>  <p class="xxt2 st_8de914eebc8beeba" ><span class="st_12a2efca938b9545">任何一份职业都需要社会的认可与尊重</span></p>  <p class="a st_220834aaa02770ba" ><span class="st_c04e05dcac9ece7a">早年去欧洲，在瑞典的斯德哥尔摩市政厅里见到过这样的情景：</span><span class="st_af6b9b809f7b5d31">3</span><span class="st_c04e05dcac9ece7a">个人共同竞争一份秘书的工作，其中一个人是硕士毕业，另一个有相关工作经验，而第三个则是一位养育了</span><span class="st_af6b9b809f7b5d31">3</span><span class="st_c04e05dcac9ece7a">个孩子的</span><span class="st_af6b9b809f7b5d31">41</span><span class="st_c04e05dcac9ece7a">岁母亲，她没有很好的教育背景和工作经验，但市政府最终把工作给了她。官员的解释是这位妇女为国家养育了</span><span class="st_af6b9b809f7b5d31">3</span><span class="st_c04e05dcac9ece7a">个孩子，重返社会工作理应优先考虑。同时，政府还为她提供了</span><span class="st_af6b9b809f7b5d31">3</span><span class="st_c04e05dcac9ece7a">个月的带薪培训以帮助她胜任工作。可见，在高保障型的国家，全职太太不是靠男人活着，而是依靠国家生存。所以说，对全职太太的职业价值的肯定，在社会保险及就业等方面给予优惠，这些都是对于幸福最坚实的保障。</span></p>  <p class="a st_220834aaa02770ba" ><span class="st_c04e05dcac9ece7a">因为全职太太忙于孩子养育与琐碎家务，社会功能与职业能力逐步退化是避免不了的，如果没有可靠的社会保障与支持，那么她与现实的关系就会渐行渐远。女性照料家庭、养育孩子是在为国家尽责，不是为哪个男人尽职，只有在法律上确认这一点，全职太太才能活得体面。</span></p>  <p class="a st_220834aaa02770ba" ><span class="st_c04e05dcac9ece7a">最后我想说，当一个婚姻中的男人说“我们总得有一个人来照顾家”的时候，女人也要在经济和情感权力上有自己的主张。考虑到孩子</span><span class="st_af6b9b809f7b5d31">3</span><span class="st_c04e05dcac9ece7a">岁以前，母亲在儿童身心发展中有重要作用，我赞成女性为孩子做</span><span class="st_af6b9b809f7b5d31">3</span><span class="st_c04e05dcac9ece7a">年全职母亲，给予孩子细心的呵护与陪伴。等到孩子上幼儿园以后，女性及时回归社会，发展自己的职业，拥有自己的经济实力是相对可取的。</span></p>  </div>     </div>   </div> </div> ';
